            </tr>
            <tr>
                <th>Date</th>
                <td>{{ user.date ? user.date|date('Y-m-d') : '' }}</td>
            </tr>
            <tr>
                <th>Sexe</th>
                <td>{{ user.sexe }}</td>
            </tr>
            <tr>
                <th>Numero_tele</th>
                <td>{{ user.numeroTele }}</td>
            </tr>
            <tr>
                <th>Email</th>
                <td>{{ user.email }}</td>
            </tr>
            <tr>
                <th>Roles</th>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
            </tr>
            <tr>
                <th>address</th>
                <td>{{ user.address }}</td>
            </tr>
            <tr>
                <th>Password</th>
